import "../../index.css";
import NavBar from "../NavBar/NavBar.jsx";
import "./Home.css";

const Home = () => {
  return (
    <div>
      <NavBar />
      <main>
        <div className="hero-section">
          <h1>Bienvenue sur notre boutique de jeux vidéo</h1>
          <p>Découvrez notre sélection de jeux</p>
        </div>
      </main>
    </div>
  );
};

export default Home;
